import React, { Component } from 'react';
import logo from './logo.svg';
import PlaylistContainer from './components/PlaylistContainer'
import ArtistContainer from './components/ArtistContainer'
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <PlaylistContainer/>
        <ArtistContainer/>
      </div>
    );
  }
}

export default App;
